import { Layout, Menu, Breadcrumb } from 'antd';
import {
CalendarOutlined,
ScheduleOutlined,
UserOutlined,
FileAddOutlined
} from '@ant-design/icons';
import logoUrl from '../images/logo-dark.png';
import TableSchedule from './tableSchedule'
import { Row, Col } from 'antd';
import CSVReader2 from './uploadFile'
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Navsider from './Navsider'
const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;

const Page = () => {
  const [view, setView] = useState(0)
  const [collapsed, setCollapse] = useState(false);
  const [resSchedule, setResSchedule] = useState([]);
  const [viewSelect, setViewSelect] = useState(['0']);
  const classObjects = ['charts', 'table']
  const onCollapse = (collapsed) => (setCollapse(collapsed));
  const handleView = ({ item, key, keyPath, domEvent }) => { 
    setView(key); 
    setViewSelect([key]);}
  const viewObjects = [<CSVReader2 setResSchedule={setResSchedule} setView={setView} setViewSelect={setViewSelect}/>, <TableSchedule resSchedule={resSchedule}/>]

    return (
      <Router>
      <Layout style={{ minHeight: '100vh' }}>
        <Sider collapsible collapsed={collapsed} onCollapse={onCollapse}>
            <Navsider/>
        </Sider>
        <Layout className="site-layout">
           {/*<Header className="site-layout-background" style={{ padding: 0 }} />*/}
            <Content>
              <Switch>
                <Route path="/FileUpload">
                  <FileUploadPage/>
                </Route>
                <Route path="/Dashboard">
                  Dashboard
                </Route>
                <Route path='/GenerateMeetings'>
                  <CSVReader2 setResSchedule={setResSchedule} setView={setView} setViewSelect={setViewSelect}/>
                </Route>
                <Route path='/MeetingsTable'>
                    <TableSchedule resSchedule={resSchedule}/>
                </Route>
                <Route path='/Reschedule'>
                    Rescheduling
                </Route>
              </Switch>
            </Content>
          {/*<Footer style={{ textAlign: 'center' }}>Ant Design ©2018 Created by Ant UED</Footer>*/}
        </Layout>
      </Layout>
      </Router>
    );
}

export default Page;
